script: |
  super -f tsv -I q350.sql | sort > q350.out

vector: true

inputs:
  - name: q350.sql
    data: |
      SELECT DISTINCT + + 87, - col0 / + col1 AS col2 FROM tab0 AS cor0 WHERE NOT + col2 <= - - CAST ( col1 AS INTEGER ) * + - col1;
  - name: tab0

outputs:
  - name: q350.out
    data: |
      87	-4
      87	-97
      87	0
